import React, { useState } from "react";

export const Api = () => {
    
    useEffect(()=>{
        axios.get('https://dummyjson.com/carts').then(
            (result)=>{
    
                var [Apidata,updateApi] = useState()

            updateApi(result.data.carts)
                    
            })
    },[])

    return Apidata

}

export default Api
